import React from 'react'
import logo from './commons/images/logo.jpg';

import {
    DropdownItem,
    DropdownMenu,
    DropdownToggle,
    Nav,
    Navbar,
    NavbarBrand,
    NavLink,
    UncontrolledDropdown
} from 'reactstrap';

const textStyle = {
    color: 'white',
    textDecoration: 'none'
};

const NavigationBar2 = () => (
    <div>
        <Navbar color="dark" light expand="md">
            <NavbarBrand href="/home1">


                <img src={logo} width={"50"}
                     height={"35"} />
            </NavbarBrand>
            <Nav className="mr-auto" navbar>

                <UncontrolledDropdown nav inNavbar>
                    <DropdownToggle style={textStyle} nav caret>
                        Menu
                    </DropdownToggle>
                    <DropdownMenu right >

                        {/*<DropdownItem>*/}
                        {/*    <NavLink href="/mydevices">My Devices</NavLink>*/}
                        {/*</DropdownItem>*/}

                        <DropdownItem>
                            <NavLink href="/device">All Devices</NavLink>
                        </DropdownItem>


                    </DropdownMenu>
                </UncontrolledDropdown>

            </Nav>
        </Navbar>
    </div>
);

export default NavigationBar2
